import React from "react";
import badge from "./badge.svg";
import styled from "styled-components";
import ImgWrapper from "../../global/images/ImgWrapper";

const Complete = (props) => {
  const Image = styled.img`
    max-width: 80vw;
    margin: auto auto;
  `;

  return (
    <>
      <ImgWrapper>
        <Image src={badge} />
      </ImgWrapper>
    </>
  );
};

export default Complete;
